import React, { Component } from 'react';

import './Header.css';

export default class Header extends Component {
    constructor() {
        super();
        this.state = {
        };
    }

    render() {
        return (
            <div className="header-wrap">
                <div className="header">
                    <div className="logo-branding" href="#bottompage">MBM</div>
                    <div className="social-media-wrap">
                        <ul>
                            <li>
                                <a href="www.facebook.com" target="_blank">Facebook
                                <img src={require('./FBblack.png')} alt="FB" target="_blank"/>
                                </a>
                            </li>
                            <li>
                                <a href="twitter">Twitter
                                <img src={require('./twitterblack.png')} alt="Twitter"/>                                
                                </a>
                            </li>
                            <li>
                                <a href="instagram">Instagram
                                <img src={require('./Instagram.png')} alt="Instagram"/>
                                </a>
                            </li>
                            <li>
                                <a href="extra">Contact
                                <img src={require('./Mail.png')} alt="Contact"/>
                                </a>
                            </li>




                        </ul>
                    </div>
                </div>
            </div>
                )
        }}
